    false,nt"url": null,nt"notes": "Management activities outlined in this
    plan include forest protection, grassland management, and wetland restoration, wildlife
    nesting structures and restoring derelict lands. This involves the maintenance and
    restoration of native communities, including grasslands and pine barren habitats
    for wildlife, prescribed burning; maintaining nesting structures (Eastern bluebird
    boxes, Osprey platforms, and wood duck boxes), and controlling invasive species.
    Wildlife management goals include maintaining and enhancing populations of migratory
    birds and other fauna, and enhancing populations of federally and state listed threatened
    and endangered species where appropriate. Current management activities include
